import React from 'react';
import styles from './App.module.css';
import Votes from "./data.json";
import { DataGrid } from '@mui/x-data-grid';

const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'county_desc', headerName: 'county_desc', width: 130 },
  { field: 'first_name', headerName: 'first_name', width: 150 },
  { field: 'last_name', headerName: 'last_name', width: 150 },
  { field: 'voter_status_desc', headerName: 'voter_status_desc', width: 100 },
  { field: 'voter_status_reason_desc', headerName: 'voter_status_reason_desc', width: 500 },
  { field: 'res_street_address', headerName: 'res_street_address', width: 250 },
  { field: 'res_city_desc', headerName: 'res_city_desc', width: 150 },
  { field: 'state_cd', headerName: 'state_cd', width: 50 },
  { field: 'zip_code', headerName: 'zip_code', width: 70 },
  { field: 'mail_addr1', headerName: 'mail_addr1', width: 250 },
  { field: 'mail_city', headerName: 'mail_city', width: 150 },
  { field: 'mail_state', headerName: 'mail_state', width: 50 },
  { field: 'mail_zipcode', headerName: 'mail_zipcode', width: 70 },
  { field: 'full_phone_number', headerName: 'full_phone_number', width: 100 },
  { field: 'registr_dt', headerName: 'registr_dt', width: 100 },
  { field: 'race_code', headerName: 'race_code', width: 100 },
  { field: 'gender_code', headerName: 'gender_code', width: 100 },
  { field: 'birth_year', headerName: 'birth_year', width: 100 },
];

function App() {
  return (
    <div>
      <div style={{ height: '100vh', width: '100%' }}>
        <DataGrid
          rows={Votes}
          columns={columns}
          pageSize={100}
          rowsPerPageOptions={[100]}
          checkboxSelection
        />
      </div>
    </div>
  );
}

export default App;
